    false,nt"url": null,nt"notes": "This monthly narrative report for Great
    Meadows National Wildlife Refuge Complex outlines Refuge accomplishments during
    February 1998. The report begins with a summary of the month's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses management plans, compliance with environmental mandates, and research
    and investigations. Refuge administration is outlined; information about personnel,
    funding, and safety is given.  The wildlife section of the report discusses waterfowl.
    The public uses of the Refuge described in this report include  interpretive programs,
    wildlife observation, outdoor recreation, and law enforcement. The equipment and
    facilities section of the report provides information about rehabilitation, major
    maintenance, and equipment utilization and management. Cooperative programs and
    items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
